wwv_flow_api.create_list(
 p_id=>wwv_flow_api.id(54161823272608410545)
,p_name=>'Menus'
,p_list_type=>'SQL_QUERY'
,p_list_query=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT',
'  1 level1,',
'  ap.page_name label,',
'  ''f?p=''',
'  ||aa.apex_application_id',
'  ||'':''',
'  ||ap.apex_page_id',
'  || '':&SESSION.::::AD_MENU_ID:'' target,',
'  DECODE(:ad_menu_id, NULL, ''YES'', ''NO'') is_current,',
'  NVL(ap.page_icon, ''fa-home'') image,',
'  0 row_num',
'FROM',
'  ad_roles ar,',
'  ad_pages ap,',
'  ad_applications aa',
'WHERE',
'  ar.home_page        = ap.page_id',
'AND ap.application_id = aa.application_id',
'AND role_id           = :ad_role_id',
'UNION',
'SELECT',
'  1 level1,',
'  ''Reports'' label,',
'  ''f?p=&APP_ID.:50:&SESSION.::::AD_MENU_ID:0'' target,',
'  DECODE(:ad_menu_id, 0, ''YES'', ''NO'') is_current,',
'  ''fa-bars'' image,',
'  0.1 row_num',
'FROM',
'  ad_roles ar',
'WHERE',
'  role_id            = :ad_role_id',
'AND report_group_id IS NOT NULL',
'UNION',
'SELECT',
'  level1 level1,',
'  label,',
'  target,',
'  is_current,',
'  image,',
'  row_num',
'FROM',
'  (',
'    SELECT',
'      level level1,',
'      DECODE(amd.page_id, NULL, am.menu_name, ap.page_name) label,',
'      DECODE(amd.sub_menu_id, NULL, ''f?p=''',
'      ||aa.apex_application_id',
'      ||'':''',
'      ||ap.apex_page_id',
'      ||',
'      '':&SESSION.::::AD_APPLICATION_ID,AD_PAGE_ID,AD_PAGE_NAME,AD_READ_ONLY_PAGE,AD_UNIQUE_NAME_COLUMN:''',
'      ||aa.application_id',
'      ||'',''',
'      ||ap.page_id',
'      ||'',''',
'      ||ap.page_name',
'      ||'',''',
'      ||DECODE(amd.read_only, NULL, ap.read_only, ''Y'')',
'      ||'',''',
'      || ap.unique_name_column,',
'      (',
'        SELECT',
'          ''f?p=''',
'          ||aah.apex_application_id',
'          ||'':''',
'          ||aph.apex_page_id',
'          || '':&SESSION.::::AD_MENU_ID:''',
'        FROM',
'          ad_roles arh,',
'          ad_pages aph,',
'          ad_applications aah',
'        WHERE',
'          arh.home_page        = aph.page_id',
'        AND aph.application_id = aah.application_id',
'        AND arh.role_id        = :ad_role_id',
'      )',
'      ||amd.sub_menu_id) target,',
'      DECODE(:ad_menu_id, NVL(amd.sub_menu_id, amd.menu_id), ''YES'', ''NO'')',
'      is_current,',
'      DECODE(amd.sub_menu_id, NULL, NVL(ap.page_icon, ''fa-caret-right'') ,NVL(',
'      am.menu_icon, ''fa-angle-down'')) image,',
'      rownum row_num',
'    FROM',
'      (',
'        SELECT',
'          amd1.*',
'        FROM',
'          ad_menus am1,',
'          ad_menu_details amd1',
'        WHERE',
'          am1.menu_id   = amd1.menu_id',
'        AND am1.enabled = ''Y''',
'        AND sysdate BETWEEN NVL(am1.date_from, sysdate) AND NVL(am1.date_to,',
'          sysdate)',
'        AND amd1.enabled = ''Y''',
'        AND sysdate BETWEEN NVL(amd1.date_from, sysdate) AND NVL(amd1.date_to,',
'          sysdate)',
'      )',
'      amd,',
'      ad_menus am,',
'      ad_pages ap,',
'      ad_applications aa',
'    WHERE',
'      NVL(amd.sub_menu_id, 200101010000001) = am.menu_id',
'    AND NVL(amd.page_id, 200101010000001)   = ap.page_id',
'    AND ap.application_id     = aa.application_id',
'    AND am.enabled            = ''Y''',
'    AND sysdate BETWEEN NVL (am.date_from, sysdate) AND NVL (am.date_to,',
'      sysdate)',
'    AND ap.enabled = ''Y''',
'    AND sysdate BETWEEN NVL (ap.date_from, sysdate) AND NVL (ap.date_to,',
'      sysdate)',
'    AND aa.enabled = ''Y''',
'    AND sysdate BETWEEN NVL (aa.date_from, sysdate) AND NVL (aa.date_to,',
'      sysdate)',
'      START WITH amd.menu_id =',
'      (',
'        SELECT',
'          menu_id',
'        FROM',
'          ad_roles',
'        WHERE',
'          role_id = :ad_role_id',
'      )',
'      CONNECT BY nocycle prior amd.sub_menu_id = amd.menu_id',
'    ORDER SIBLINGS BY',
'      amd.sequence',
'  )',
'ORDER BY',
'  row_num ASC'))
,p_list_status=>'PUBLIC'
);
end;
