wwv_flow_api.create_flow_computation(
 p_id=>wwv_flow_api.id(54163070068345957132)
,p_computation_sequence=>70
,p_computation_item=>'AD_ALLOW_DELETE'
,p_computation_point=>'BEFORE_HEADER'
,p_computation_type=>'QUERY'
,p_computation_processed=>'REPLACE_EXISTING'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT DISTINCT 1',
'FROM AD_PROFILES AP,',
'  AD_PROFILE_VALUES APV',
'WHERE AP.PROFILE_ID = APV.PROFILE_ID',
'AND AP.PROFILE      = ''ALLOW_DELETES''',
'AND AP.ENABLED      = ''Y''',
'AND SYSDATE BETWEEN NVL(AP.DATE_FROM, SYSDATE) AND NVL(AP.DATE_TO, SYSDATE)',
'AND APV.ENABLED = ''Y''',
'AND SYSDATE BETWEEN NVL(APV.DATE_FROM, SYSDATE) AND NVL(APV.DATE_TO, SYSDATE)',
'AND ((APV.PROFILE_LEVEL  = 1',
'AND APV.VALUE            = ''Y'')',
'OR (APV.PROFILE_LEVEL    = 2',
'AND APV.PROFILE_LEVEL_ID = :AD_APPLICATION_ID',
'AND APV.VALUE            = ''Y'')',
'OR (APV.PROFILE_LEVEL    = 3',
'AND APV.PROFILE_LEVEL_ID = :AD_ROLE_ID',
'AND APV.VALUE            = ''Y'')',
'OR (APV.PROFILE_LEVEL    = 4',
'AND APV.PROFILE_LEVEL_ID = :AD_USER_ID',
'AND APV.VALUE            = ''Y'') )'))
);
wwv_flow_api.create_flow_computation(
 p_id=>wwv_flow_api.id(54160126483557461857)
,p_computation_sequence=>80
,p_computation_item=>'AD_ALLOW_APPROVAL'
,p_computation_point=>'BEFORE_HEADER'
,p_computation_type=>'QUERY'
,p_computation_processed=>'REPLACE_EXISTING'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT DISTINCT 1',
'FROM AD_PROFILES AP,',
'  AD_PROFILE_VALUES APV',
'WHERE AP.PROFILE_ID = APV.PROFILE_ID',
'AND AP.PROFILE      = ''ALLOW_APPROVALS''',
'AND AP.ENABLED      = ''Y''',
'AND SYSDATE BETWEEN NVL(AP.DATE_FROM, SYSDATE) AND NVL(AP.DATE_TO, SYSDATE)',
'AND APV.ENABLED = ''Y''',
'AND SYSDATE BETWEEN NVL(APV.DATE_FROM, SYSDATE) AND NVL(APV.DATE_TO, SYSDATE)',
'AND ((APV.PROFILE_LEVEL  = 1',
'AND APV.VALUE            = ''Y'')',
'OR (APV.PROFILE_LEVEL    = 2',
'AND APV.PROFILE_LEVEL_ID = :AD_APPLICATION_ID',
'AND APV.VALUE            = ''Y'')',
'OR (APV.PROFILE_LEVEL    = 3',
