'AU.FIRST_NAME "FIRST_NAME",',
'AU.LAST_NAME "LAST_NAME",',
'ANU.MANAGER "MANAGER",',
'AU.EMAIL "EMAIL",',
'AU.PHONE "PHONE",',
'AU.ENABLED "ENABLED",',
'AU.DATE_FROM "DATE_FROM",',
'AU.DATE_TO "DATE_TO",',
'(SELECT USER_NAME FROM AD_USERS WHERE USER_ID = AU.CREATED_BY) "CREATED_BY",',
'AU.CREATED_ON "CREATED_ON",',
'(SELECT USER_NAME FROM AD_USERS WHERE USER_ID = AU.UPDATED_BY) "UPDATED_BY",',
'AU.UPDATED_ON "UPDATED_ON"',
'from "#OWNER#"."AD_USERS" AU, AN_USERS ANU',
'where AU.USER_ID = ANU.AD_USER_ID',
'and (ANU.ORGANIZATION_ID = (SELECT ORGANIZATION_ID FROM AN_USERS ANU1 WHERE ANU1.AD_USER_ID = :AD_USER_ID)',
'OR EXISTS (SELECT 1 FROM AD_ROLES AR',
'WHERE AR.ROLE = ''ANNOTATION_ADMINISTRATOR''',
'AND ROLE_ID = :AD_ROLE_ID))',
''))
