,p_process_name=>'Insert User'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'BEGIN',
'    UPDATE ad_users',
'        SET',
'            password =:p201_password',
'    WHERE',
'        user_id =:p201_user_id;',
'',
'    INSERT INTO an_users (',
'        user_id,',
'        organization_id,',
'        ad_user_id,',
'        manager,',
'        enabled,',
'        date_from,',
'        date_to,',
'        created_by,',
'        created_on,',
'        updated_by,',
'        updated_on',
'    ) VALUES (',
'        TO_CHAR(SYSDATE,''YYYYMMDD'')',
'         ||  lpad("AN_USERS_S".NEXTVAL,7,0),',
'        :p201_organization_id,',
'        :p201_user_id,',
'        :p201_manager,',
'        :p201_enabled,',
'        :p201_date_from,',
'        :p201_date_to,',
'        :p201_created_by,',
'        :p201_created_on,',
'        :p201_updated_by,',
'        :p201_updated_on',
'    );',
'',
'    IF :p201_manager = ''Y'' THEN',
'        INSERT INTO ad_user_roles (',
'            user_role_id,',
'            user_id,',
'            role_id,',
'            default_role,',
'            enabled,',
'            date_from,',
'            date_to,',
'            created_by,',
'            created_on,',
'            updated_by,',
'            updated_on',
'        ) VALUES (',
'            TO_CHAR(SYSDATE,''YYYYMMDD'')',
'             ||  lpad(ad_user_roles_s.NEXTVAL,7,0),',
'            :p201_user_id,',
'            (',
'                SELECT',
'                    role_id',
'                FROM',
'                    ad_roles',
'                WHERE',
'                        role',
'                    = ''ANNOTATION_MANAGER''',
'            ),',
'            ''Y'',',
'            ''Y'',',
'            NULL,',
'            NULL,',
'            :p201_created_by,',
'            :p201_created_on,',
'            :p201_updated_by,',
'            :p201_updated_on',
'        );',
'',
'    END IF;',
'',
'END;'))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_api.id(245288632017283278)
