wwv_flow_api.create_page_process(
 p_id=>wwv_flow_api.id(139688413616092020)
,p_process_sequence=>50
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Update User'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    ln_user_role_count   NUMBER;',
'    ln_manager_role_id   NUMBER;',
'BEGIN',
'    UPDATE an_users',
'        SET',
'            organization_id =:p201_organization_id,',
'            manager =:p201_manager,',
'            enabled =:p201_enabled,',
'            date_from =:p201_date_from,',
'            date_to =:p201_date_to,',
'            updated_by =:p201_updated_by,',
'            updated_on =:p201_updated_on',
'    WHERE',
'        ad_user_id =:p201_user_id;',
'',
'    SELECT',
'        role_id',
'    INTO',
'        ln_manager_role_id',
'    FROM',
'        ad_roles',
'    WHERE',
'        role = ''ANNOTATION_MANAGER''',
'    AND',
'        ROWNUM = 1;',
'',
'    SELECT',
'        COUNT(*)',
'    INTO',
'        ln_user_role_count',
'    FROM',
'        ad_user_roles',
'    WHERE',
'        user_id =:p201_user_id',
'    AND',
'        role_id = ln_manager_role_id;',
'',
'    IF :p201_manager = ''Y'' THEN',
'        IF ln_user_role_count = 0 THEN',
'            INSERT INTO ad_user_roles (',
'                user_role_id,',
'                user_id,',
'                role_id,',
'                default_role,',
'                enabled,',
'                date_from,',
'                date_to,',
'                created_by,',
'                created_on,',
'                updated_by,',
'                updated_on',
'            ) VALUES (',
'                TO_CHAR(SYSDATE,''YYYYMMDD'')',
'                 ||  lpad(ad_user_roles_s.NEXTVAL,7,0),',
'                :p201_user_id,',
'                ln_manager_role_id,',
'                ''Y'',',
'                ''Y'',',
'                NULL,',
'                NULL,',
'                :p201_created_by,',
'                :p201_created_on,',
'                :p201_updated_by,',
'                :p201_updated_on',
'            );',
'',
'        ELSE',
'            UPDATE ad_user_roles',
'                SET',
'                    enabled = ''Y''',
'            WHERE',
'                user_id =:p201_user_id',
'            AND',
'                role_id = ln_manager_role_id;',
'',
'        END IF;',
'    ELSE',
'        IF ln_user_role_count <> 0 THEN',
'            UPDATE ad_user_roles',
'                SET',
'                    enabled = NULL',
'            WHERE',
'                user_id =:p201_user_id',
'            AND',
'                role_id = ln_manager_role_id;',
'',
'        END IF;',
'    END IF;',
'',
'END;'))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_api.id(245288271306283278)
);
